var req_body = JSON.parse(request_body);
var req_vendor_body = [];
for (var key in req_body) {
 var outputobj={};
 outputobj['op'] = 'replace';
 outputobj['path'] = '/' + key;
 outputobj['value'] = req_body[key]
 req_vendor_body.push(outputobj);
}
done({ 
  "request_vendor_body" : req_vendor_body
});

if (request_parameters) {
    if (request_parameters.size && request_parameters.type) {
        var reqVendorUrl = 'https://images.typeform.com/images/' + request_path_variables.id + '/' + request_parameters.type + '/' + request_parameters.size;
        done({
            "continue": true,
            request_vendor_path: reqVendorUrl
        });
    } else if (request_parameters.size || request_parameters.type) {
        done({
            "continue": false,
            "response_body": {
                "error": `Please provide valid values for both parameters type and size.`
            },
            "response_status_code": 400
        });
    }
}
done();

let configs = configuration;
let path = request_vendor_path;
path += "?client_id=" + request_parameters['client_id'];
path += "&scope=" +  configs['oauth.scope'];
path += "&response_type=code&state=typeform";
path += "&redirect_uri=" + encodeURIComponent(request_parameters['redirect_uri']);

done({
	"request_vendor_path": path,
});

var op;
if (request_parameters !== undefined) {
    op = request_parameters.operation;
}
if (op == null) {
    op = 'replace';
}
var req_body = JSON.parse(request_body);
var req_vendor_body = [];
for (var key in req_body) {
    var outputobj = {};
    outputobj['op'] = op;
    outputobj['path'] = '/' + key;
    outputobj['value'] = req_body[key]
    req_vendor_body.push(outputobj);
}
done({
    "request_vendor_body": req_vendor_body
});
